import "./App.css";

function HiddenContent() {
  return (
    <div className="border border-black p-4 m-10 overflow-hidden w-[500px] h-[500px]">
      Content to be hidden until hovered or focused.
    </div>
  );
}

function App() {
  return (
    <div className="w-screen h-screen bg-blue-200 flex items-center justify-center">
      <HiddenContent />
    </div>
  );
}

export default App;
